const Education = () => {
  return (
    <div style={{ minHeight: '80vh', backgroundColor: '#666', color: '#fff', padding: '2rem', animation: 'fadeIn 1s ease-in' }}>
      <h1 style={{ color: '#ff6600', fontSize: '2.5rem', marginBottom: '1rem', textAlign: 'center', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>Education</h1>
      <div style={{ maxWidth: '600px', margin: '0 auto', backgroundColor: '#555', padding: '2rem', borderRadius: '10px', boxShadow: '0 4px 8px rgba(0,0,0,0.2)', transition: 'transform 0.3s ease' }} onMouseEnter={(e) => e.target.style.transform = 'scale(1.02)'} onMouseLeave={(e) => e.target.style.transform = 'scale(1)'}>
        <h3 style={{ color: '#ff6600' }}>Government Engineering College, Bharuch</h3>
        <p style={{ color: '#ddd' }}>Affiliated with Gujarat Technological University</p>
        <p style={{ color: '#ddd' }}>Bachelor of Engineering in Computer Engineering</p>
        <p style={{ color: '#ddd' }}>Expected Graduation: June 2026</p>
        <p style={{ color: '#ddd' }}><strong>Relevant Coursework:</strong> Data Structures and Algorithms, Data Science, Machine Learning, Artificial Intelligence, Probability and Statistics, Linear Algebra</p>
      </div>
      <style>
        {`
          @keyframes fadeIn {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
          }
        `}
      </style>
    </div>
  );
};

export default Education;
